import UserKeyData from '../core/UserKeyData'

export default class UserKeyDataMapper {
    static convertToKeyData(json) {
        return new UserKeyData({
            id: json.data.id,
            calories: json.data.keyData.calorieCount,
            protein: json.data.keyData.proteinCount,
            carb: json.data.keyData.carbohydrateCount,
            lipid: json.data.keyData.lipidCount,
        })
    }
}
